import mc from "./sign-up.module.scss";
import { useDispatch, useSelector } from "react-redux";
import { setItem } from "../../../utils/storage.utils";
import InputLogin from "../inputs/inputLogin";

const SignUp = ({ onError }) => {
  const dispatch = useDispatch();
  const { signUp } = useSelector((store) => {
    return { signUp: store.signUpReducer };
  });

  const handleInputChange = (key, value) => {
    dispatch({ type: "UPDATE_SIGNUP_FIELD", payload: { key, value } });
  };

  const handleInputActive = (e, input) => {
    dispatch({ type: "LABEL_SIGNUP_TOP", payload: { input } });
  };

  const handleInputInactive = (e, input) => {
    if (e.target.value.length <= 0)
      dispatch({ type: "LABEL_SIGNUP_DOWN", payload: { input } });
  };

  const closeLogin = () => {
    dispatch({ type: "CLOSE_LOGIN" });
    dispatch({ type: "CLEAN_SIGNUP_ALL" });
  };

  const openSignIn = () => {
    dispatch({ type: "OPEN_SIGNIN" });
    cleanInputsValue();
  };

  const cleanInputsValue = () => {
    dispatch({ type: "CLEAN_SIGNUP_INPUTS" });
  };

  const isLogged = () => {
    dispatch({ type: "IS_LOGGED" });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    let result;
    let status;

    const form = {
      pseudo: signUp.pseudo.value,
      email: signUp.email.value,
      confirmEmail: signUp.confirmEmail.value,
      password: signUp.password.value,
      confirmPassword: signUp.confirmPassword.value,
    };

    const config = {
      method: "POST",
      body: JSON.stringify(form),
      headers: {
        "content-type": "application/json; charset=UTF-8",
      },
    };

    try {
      const response = await fetch(
        `http://localhost:7001/users/sign-up`,
        config
      );
      console.log(response);
      status = response.status;
      result = await response.json();
    } catch (e) {
      console.error(`Problem with request ${e.message}`);
      onError();
      return;
    }

    if (status >= 400) {
      onError(status);
      return;
    }

    setItem("token", result.token);
    isLogged();
    cleanInputsValue();
  };

  return (
    <div className={mc.container}>
      <div className={mc.login_close}>
        <button onClick={closeLogin}>X</button>
      </div>

      <form className={mc.form} onSubmit={(e) => handleSubmit(e)}>
        <div className={mc.title}>
          <p>Inscription</p>
        </div>
        <div className={mc.inputs}>
          <InputLogin
            labelUp={signUp.pseudo.selected}
            labelContent="Pseudo"
            inputType="text"
            inputValue={signUp.pseudo.value}
            handleInputChange={(e) =>
              handleInputChange("pseudo", e.target.value)
            }
            handleInputActive={(e) => handleInputActive(e, "pseudo")}
            handleInputInactive={(e) => handleInputInactive(e, "pseudo")}
          />
          <div className={mc.email}>
            <InputLogin
              labelUp={signUp.email.selected}
              labelContent="Email"
              inputType="text"
              inputValue={signUp.email.value}
              handleInputChange={(e) =>
                handleInputChange("email", e.target.value)
              }
              handleInputActive={(e) => handleInputActive(e, "email")}
              handleInputInactive={(e) => handleInputInactive(e, "email")}
            />
            <InputLogin
              labelUp={signUp.confirmEmail.selected}
              labelContent="Confirm email"
              inputType="text"
              inputValue={signUp.confirmEmail.value}
              handleInputChange={(e) =>
                handleInputChange("confirmEmail", e.target.value)
              }
              handleInputActive={(e) => handleInputActive(e, "confirmEmail")}
              handleInputInactive={(e) =>
                handleInputInactive(e, "confirmEmail")
              }
            />
          </div>
          <div className={mc.password}>
            <InputLogin
              labelUp={signUp.password.selected}
              labelContent="Password"
              inputType="password"
              inputValue={signUp.password.value}
              handleInputChange={(e) =>
                handleInputChange("password", e.target.value)
              }
              handleInputActive={(e) => handleInputActive(e, "password")}
              handleInputInactive={(e) => handleInputInactive(e, "password")}
            />
            <InputLogin
              labelUp={signUp.confirmPassword.selected}
              labelContent="Confirm password"
              inputType="password"
              inputValue={signUp.confirmPassword.value}
              handleInputChange={(e) =>
                handleInputChange("confirmPassword", e.target.value)
              }
              handleInputActive={(e) => handleInputActive(e, "confirmPassword")}
              handleInputInactive={(e) =>
                handleInputInactive(e, "confirmPassword")
              }
            />
          </div>
        </div>
        <div className={mc.connect}>
          <button type="submit" onClick={(e) => handleSubmit(e)}>
            <span>S'incrire</span>
          </button>
          <span className={mc.openSignIn} onClick={openSignIn}>
            Déjà client ?
          </span>
        </div>
      </form>
    </div>
  );
};

export default SignUp;
